import React,{useEffect} from "react";
import imageApi from "../../common/apis/imageApi";
import {APIKey} from "../../common/apis/imageApiKey";
import ImageCard from "../ImageCard/ImageCard";
import { useDispatch, useSelector } from "react-redux";
import {addImages, getAllImages, fetchAsyncImages} from "../../features/Images/imageSlice";
import './Tree.css'

const Tree = () => {
    const dispatch = useDispatch();
    useEffect(()=>{
        dispatch(fetchAsyncImages);
    },[dispatch]);

    const images = useSelector(getAllImages);
    let renderImages= "";

    renderImages =
    images.hits.length>0? (
        images.hits.map((image, index) => (
        <ImageCard key={index} data={image} />
      ))
    ) : (
      <div>
        <h3>{images.Error}</h3>
      </div>
    );
    return (
        <div className="conatiner">
            <div className="image-container">{renderImages}</div>
        </div>
    );
};

export default Tree;
